import React from "react";
import "./footer.css";

import { Container, Row, Col, ListGroup, ListGroupItem } from "reactstrap";

import {Link } from "react-router-dom";
import logo from "../../assets/images/logo.png";

const quick_links = [
    {
      path: '/home',
      display: 'Home'
    },
    {
      path: '/about',
      display: 'About'
    },
    {
      path: '/tours',
      display: 'Tours'
    },
  ];

  const quick_links2 = [
    {
      path: '/gallery',
      display: 'Gallery'
    },
    {
      path: '/login',
      display: 'Login'
    },
    {
      path: '/register',
      display: 'Register'
    },
  ];

const footer = () => {
    return (
        <footer className="footer">
            <Container>
                <Row>
                   <Col lg="3">
                    <div className="logo">
                        <img src={logo} alt=""/>
                        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Similique ullam dolore cupiditate debitis libero consectetur quam ducimus, provident unde inventore totam, voluptatum fugit eveniet blanditiis possimus reiciendis obcaecati pariatur quod.</p>
                        <div className="social_links d-flex aligh-items-center gap-4">
                            <span>
                                <link to="#"><i class="ri-youtube-line"></i></link>
                            </span>
                            <span>
                                <link to="#"><i class="ri-github-fill"></i></link>
                            </span>
                            <span>
                                <link to="#"><i class="ri-facebook-circle-line"></i></link>
                            </span>
                            <span>
                                <link to="#"><i class="ri-instagram-line"></i></link>
                            </span>
                        </div>
                    </div>
                   </Col>

                   <Col lg="3">
                    <h5 className="footer_link-title">Discover</h5>

                    <ListGroup className="footer_link-links">
                        {
                            quick_links.map((item,index)=> (
                                <ListGroupItem key={index} className='ps-0 bo'>
                                    <Link to={item.path}>{item.display}</Link>
                                </ListGroupItem>
                            ))
                        }

                    </ListGroup>
                   </Col>
                   <Col lg="3"></Col>
                   <Col lg="3"></Col>
                </Row>
            </Container>
        </footer>
    )
};

export default footer;
